import 'bootstrap/dist/css/bootstrap.min.css';
import NavbarComp from '../components/Navbar';
import Footer from '../components/Footer';
import { Router } from 'react-router';

function App() {
  return (
    <div className="App">
      <Router>
      <NavbarComp/>
      <Footer/>
      </Router>
    </div>
  );
}

export default App;
